import "./App.css";
import { BrowserRouter,Routes, Route ,Link,Navigate} from "react-router-dom";
import Indexinter from "./components/Indexinter"


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route exact path="/Index"><Indexinter/></Route>
          <Navigate to="/Index"/>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
